import './App.css';
import Navbar from './components/Navbar';
import LoginPage from './components/LoginPage';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
function App() {
  return (
   <Router>
    <Navbar title="Rentify"/>
    <Routes>
        <Route path="/login" element={<LoginPage />} />
    </Routes>
  </Router>
  );
}

export default App;
